def convertToPostfix(infix):
    PRECEDENCE = {'': 1, '-': 1, '*': 2, '/': 2}
    output = []
    operator_stack = []
    for char in infix:
        if char.isdigit():
            output.append(char)
        elif char == '(':
            operator_stack.append(char)
        elif char == ')':
            while operator_stack and operator_stack[-1] != '(':
                output.append(operator_stack.pop())
            operator_stack.pop()
        else:
            while operator_stack and operator_stack[-1] != '(' and (PRECEDENCE[char] <= PRECEDENCE[operator_stack[-1]]):
                output.append(operator_stack.pop())
            operator_stack.append(char)
    while operator_stack:
        output.append(operator_stack.pop())
    return ' '.join(output)

def calculatePostfix(postfix):
    stack = []
    for char in postfix.split():
        if char.isdigit():
            stack.append(int(char))
        else:
            right = stack.pop()
            left = stack.pop()
            if char == '+':
                result = left + right
            elif char == '-':
                result = left - right
            elif char == '*':
                result = left * right
            elif char == '/':
                result = left / right
            stack.append(result)
    return stack[0]

